import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './KnowMorePage.css';

const KnowMorePage = () => {
  const [tilt, setTilt] = useState({ x: 0, y: 0 });
  const [currentImage, setCurrentImage] = useState(0);
  const images = [
    '/assets/carousel1.jpg',
    '/assets/carousel2.jpg',
    '/assets/carousel3.jpg',
    '/assets/i7.j', // Add more images here as needed
  ];

  // Handle image carousel
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImage((prevIndex) => (prevIndex + 1) % images.length);
    }, 2000); // Image changes every 2 seconds

    return () => clearInterval(interval); // Clean up the interval on component unmount
  }, []);

  const handleMouseMove = (e) => {
    const card = e.currentTarget;
    const { offsetWidth: width, offsetHeight: height } = card;
    const { offsetX: x, offsetY: y } = e.nativeEvent;

    const xTilt = (y / height - 0.5) * 30;
    const yTilt = (x / width - 0.5) * -30;

    setTilt({ x: xTilt, y: yTilt });
  };

  const goToNextImage = () => {
    setCurrentImage((prevIndex) => (prevIndex + 1) % images.length);
  };

  const goToPreviousImage = () => {
    setCurrentImage(
      (prevIndex) => (prevIndex - 1 + images.length) % images.length
    );
  };

  return (
    <div className="know-more-page">
      <nav
        style={{
          position: 'absolute',
          top: 10,
          left: 0,
          width: '100%',
          background: 'transparent',
          zIndex: 1,
          padding: '10px',
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
        }}
      ></nav>

      {/* NWA News and Reports Section */}
      <div className="nwa-news-text">NWA News and Reports</div>

      <div className="know-more-content">
        <Link to="/" style={{ textDecoration: 'none', fontSize: '18px' }}>
          Go Back to Landing Page
        </Link>
      </div>

      {/* Image Cards Section */}
      <div className="image-cards">
        <div
          className="card"
          onMouseMove={handleMouseMove}
          style={{
            transform: `rotateX(${tilt.x}deg) rotateY(${tilt.y}deg)`,
          }}
        >
          <img src="/assets/i1.png" alt="Aviation News" className="card-img" />
          <div className="card-content">
            <h2>Image 1</h2>
          </div>
        </div>
        <div
          className="card"
          onMouseMove={handleMouseMove}
          style={{
            transform: `rotateX(${tilt.x}deg) rotateY(${tilt.y}deg)`,
          }}
        >
          <img src="/assets/i2.png" alt="Industry Trends" className="card-img" />
          <div className="card-content">
            <h2>Image 2</h2>
          </div>
        </div>
        <div
          className="card"
          onMouseMove={handleMouseMove}
          style={{
            transform: `rotateX(${tilt.x}deg) rotateY(${tilt.y}deg)`,
          }}
        >
          <img src="/assets/i3.png" alt="Reports" className="card-img" />
          <div className="card-content">
            <h2>Image 3</h2>
          </div>
        </div>
      </div>

      {/* Electric Aviation Section */}
      <div className="electric-aviation-text">
        <h1 className="main-heading">Pioneering Electric Aviation</h1>
        <h2 className="sub-heading">
          We’re India’s 1st Electric Propulsion Technology Company.
        </h2>
        <p className="mission-paragraph">
          Our mission is to contribute to the global effort of sustainable aviation by developing advanced electric propulsion systems for aircraft & unmanned systems. We believe that the future of flight lies in the integration of electric power & are committed to working towards a cleaner & more efficient industry.
        </p>
      </div>

      {/* UAV Propulsion Section */}
      <div className="electric-aviation-text">
        <h1 className="main-heading">UAV Propulsion</h1>
      </div>

      <div className="carousel-container">
        {/* Carousel Image */}
        <div className="carousel-image-container">
          <img
            src={images[currentImage]}
            alt={`Carousel ${currentImage}`}
            className="carousel-image"
          />
        </div>

        {/* Navigation Buttons */}
        <button className="prev-button" onClick={goToPreviousImage}>
          &#60;
        </button>
        <button className="next-button" onClick={goToNextImage}>
          &#62;
        </button>
      </div>
    </div>
  );
};

export default KnowMorePage;
